import React , { Component} from 'react'
//import { BrowserRouter as Router,Switch,Route,Link} from "react-router-dom";

class Nav extends Component{
    constructor(){
        super();
        this.handleClick = this.handleClick.bind(this.handleClick)
    }
    handleClick(){
        console.log('Hello')
    }
    render(){
        return(
            <header>
                <div className="flex-nav">
                    <div className="flex-nav-right" style={{fontSize:32}}>CNPM</div>
                    <div className="flex-nav-left">
                        <button 
                        onClick={this.handleClick}
                        id="log-btn" 
                        style={{color:'white',backgroundColor:'transparent',border:'none'}}>LOG IN
                        </button>
                    </div>
                </div>
            </header>
        )
    }
}
export default Nav;
